@testset "1.1.3.2 (c x)^m (a+b x^n)^p" begin
    @variables a, b, c, d, e, m, n, p, q, x

    #= ::Package:: =#

    #= ::Title::Closed:: =#
    #=Integrands*of*the*form*(c*x)^m*(b*x^n)^p=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(c*x)^m*(b*x^1)^p=#


    @test_int [(c*x)^m*(b*x)^p, x, 2, ((b*x)^(1 + p)*(c*x)^m)/(b*(1 + m + p))]


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(c*x)^m*(b*x^2)^p=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*x^m*(b*x^2)^(p/2)=#


    #= ::Subsubsection::Closed:: =#
    #=p>0=#


    @test_int [sqrt(b*x^2)*x^3, x, 2, (1/5)*x^4*sqrt(b*x^2)]
    @test_int [sqrt(b*x^2)*x^2, x, 2, (1/4)*x^3*sqrt(b*x^2)]
    @test_int [sqrt(b*x^2)*x^1, x, 2, (1/3)*x^2*sqrt(b*x^2)]
    @test_int [sqrt(b*x^2)*x^0, x, 2, (1/2)*x*sqrt(b*x^2)]
    @test_int [sqrt(b*x^2)/x^1, x, 2, sqrt(b*x^2)]
    @test_int [sqrt(b*x^2)/x^2, x, 2, (sqrt(b*x^2)*log(x))/x]
    @test_int [sqrt(b*x^2)/x^3, x, 2, -(sqrt(b*x^2)/x^2)]
    @test_int [sqrt(b*x^2)/x^4, x, 2, -(sqrt(b*x^2)/(2*x^3))]
    @test_int [sqrt(b*x^2)/x^5, x, 2, -(sqrt(b*x^2)/(3*x^4))]

    @test_int [sqrt(x^2)*x^2, x, 2, (1/4)*x^3*sqrt(x^2)]


    @test_int [(b*x^2)^(3/2)*x^2, x, 2, (1/6)*b*x^5*sqrt(b*x^2)]
    @test_int [(b*x^2)^(3/2)*x^1, x, 2, (1/5)*b*x^4*sqrt(b*x^2)]
    @test_int [(b*x^2)^(3/2)*x^0, x, 2, (1/4)*b*x^3*sqrt(b*x^2)]
    @test_int [(b*x^2)^(3/2)/x^1, x, 2, (1/3)*b*x^2*sqrt(b*x^2)]
    @test_int [(b*x^2)^(3/2)/x^2, x, 2, (1/2)*b*x*sqrt(b*x^2)]
    @test_int [(b*x^2)^(3/2)/x^3, x, 2, b*sqrt(b*x^2)]
    @test_int [(b*x^2)^(3/2)/x^4, x, 2, (b*sqrt(b*x^2)*log(x))/x]
    @test_int [(b*x^2)^(3/2)/x^5, x, 2, -((b*sqrt(b*x^2))/x^2)]
    @test_int [(b*x^2)^(3/2)/x^6, x, 2, -((b*sqrt(b*x^2))/(2*x^3))]
    @test_int [(b*x^2)^(3/2)/x^7, x, 2, -((b*sqrt(b*x^2))/(3*x^4))]

    @test_int [(x^2)^(3/2)*x^2, x, 2, (1/6)*x^5*sqrt(x^2)]


    @test_int [(b*x^2)^(5/2)*x^1, x, 2, (1/7)*b^2*x^6*sqrt(b*x^2)]
    @test_int [(b*x^2)^(5/2)*x^0, x, 2, (1/6)*b^2*x^5*sqrt(b*x^2)]
    @test_int [(b*x^2)^(5/2)/x^1, x, 2, (1/5)*b^2*x^4*sqrt(b*x^2)]
    @test_int [(b*x^2)^(5/2)/x^2, x, 2, (1/4)*b^2*x^3*sqrt(b*x^2)]
    @test_int [(b*x^2)^(5/2)/x^3, x, 2, (1/3)*b^2*x^2*sqrt(b*x^2)]
    @test_int [(b*x^2)^(5/2)/x^4, x, 2, (1/2)*b^2*x*sqrt(b*x^2)]
    @test_int [(b*x^2)^(5/2)/x^5, x, 2, b^2*sqrt(b*x^2)]
    @test_int [(b*x^2)^(5/2)/x^6, x, 2, (b^2*sqrt(b*x^2)*log(x))/x]
    @test_int [(b*x^2)^(5/2)/x^7, x, 2, -((b^2*sqrt(b*x^2))/x^2)]
    @test_int [(b*x^2)^(5/2)/x^8, x, 2, -((b^2*sqrt(b*x^2))/(2*x^3))]
    @test_int [(b*x^2)^(5/2)/x^9, x, 2, -((b^2*sqrt(b*x^2))/(3*x^4))]

    @test_int [(x^2)^(5/2)*x^2, x, 2, (1/8)*x^7*sqrt(x^2)]


    #= ::Subsubsection::Closed:: =#
    #=p<0=#


    @test_int [1/sqrt(b*x^2)*x^3, x, 2, x^4/(3*sqrt(b*x^2))]
    @test_int [1/sqrt(b*x^2)*x^1, x, 2, x^2/sqrt(b*x^2)]
    @test_int [1/sqrt(b*x^2)/x^1, x, 2, -(1/sqrt(b*x^2))]
    @test_int [1/sqrt(b*x^2)/x^3, x, 2, -(1/(3*x^2*sqrt(b*x^2)))]

    @test_int [1/sqrt(b*x^2)*x^2, x, 2, x^3/(2*sqrt(b*x^2))]
    @test_int [1/sqrt(b*x^2)*x^0, x, 2, (x*log(x))/sqrt(b*x^2)]
    @test_int [1/sqrt(b*x^2)/x^2, x, 2, -(1/(2*x*sqrt(b*x^2)))]


    @test_int [1/(b*x^2)^(3/2)*x^5, x, 2, x^4/(3*b*sqrt(b*x^2))]
    @test_int [1/(b*x^2)^(3/2)*x^3, x, 2, x^2/(b*sqrt(b*x^2))]
    @test_int [1/(b*x^2)^(3/2)*x^1, x, 2, -(1/(b*sqrt(b*x^2)))]
    @test_int [1/(b*x^2)^(3/2)/x^1, x, 2, -(1/(3*b*x^2*sqrt(b*x^2)))]
    @test_int [1/(b*x^2)^(3/2)/x^3, x, 2, -(1/(5*b*x^4*sqrt(b*x^2)))]

    @test_int [1/(b*x^2)^(3/2)*x^6, x, 2, x^5/(4*b*sqrt(b*x^2))]
    @test_int [1/(b*x^2)^(3/2)*x^4, x, 2, x^3/(2*b*sqrt(b*x^2))]
    @test_int [1/(b*x^2)^(3/2)*x^2, x, 2, (x*log(x))/(b*sqrt(b*x^2))]
    @test_int [1/(b*x^2)^(3/2)*x^0, x, 2, -(1/(2*b*x*sqrt(b*x^2)))]
    @test_int [1/(b*x^2)^(3/2)/x^2, x, 2, -(1/(4*b*x^3*sqrt(b*x^2)))]


    @test_int [1/(b*x^2)^(5/2)*x^7, x, 2, x^4/(3*b^2*sqrt(b*x^2))]
    @test_int [1/(b*x^2)^(5/2)*x^5, x, 2, x^2/(b^2*sqrt(b*x^2))]
    @test_int [1/(b*x^2)^(5/2)*x^3, x, 2, -(1/(b^2*sqrt(b*x^2)))]
    @test_int [1/(b*x^2)^(5/2)*x^1, x, 2, -(1/(3*b^2*x^2*sqrt(b*x^2)))]
    @test_int [1/(b*x^2)^(5/2)/x^1, x, 2, -(1/(5*b^2*x^4*sqrt(b*x^2)))]

    @test_int [1/(b*x^2)^(5/2)*x^6, x, 2, x^3/(2*b^2*sqrt(b*x^2))]
    @test_int [1/(b*x^2)^(5/2)*x^4, x, 2, (x*log(x))/(b^2*sqrt(b*x^2))]
    @test_int [1/(b*x^2)^(5/2)*x^2, x, 2, -(1/(2*b^2*x*sqrt(b*x^2)))]
    @test_int [1/(b*x^2)^(5/2)*x^0, x, 2, -(1/(4*b^2*x^3*sqrt(b*x^2)))]
    @test_int [1/(b*x^2)^(5/2)/x^2, x, 2, -(1/(6*b^2*x^5*sqrt(b*x^2)))]


    #= ::Subsection:: =#
    #=Integrands*of*the*form*(c*x)^(m/2)*(b*x^2)^(p/2)=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(c*x)^m*(b*x^2)^(p/2)*with*m*symbolic=#


    @test_int [(c*x)^m*(b*x^2)^(3/2), x, 3, (b*(c*x)^(4 + m)*sqrt(b*x^2))/(c^4*(4 + m)*x)]
    @test_int [(c*x)^m*(b*x^2)^(1/2), x, 3, ((c*x)^(2 + m)*sqrt(b*x^2))/(c^2*(2 + m)*x)]
    @test_int [(c*x)^m/(b*x^2)^(1/2), x, 3, (x*(c*x)^m)/(m*sqrt(b*x^2))]
    @test_int [(c*x)^m/(b*x^2)^(3/2), x, 3, -((c^2*x*(c*x)^(-2 + m))/(b*(2 - m)*sqrt(b*x^2)))]


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(c*x)^m*(b*x^2)^p*with*p*symbolic=#


    @test_int [x^m*(b*x^2)^p, x, 2, (x^(1 + m)*(b*x^2)^p)/(1 + m + 2*p)]
    @test_int [(c*x)^m*(b*x^2)^p, x, 3, (x*(c*x)^m*(b*x^2)^p)/(1 + m + 2*p)]


    @test_int [(x^2)^p/x^(2*p + 1), x, 2, ((x^2)^p*log(x))/x^(2*p)]


    @test_int [(b*x^2)^p*x^3, x, 2, (x^4*(b*x^2)^p)/(2*(2 + p))]
    @test_int [(b*x^2)^p*x^2, x, 2, (x^3*(b*x^2)^p)/(3 + 2*p)]
    @test_int [(b*x^2)^p*x^1, x, 2, (x^2*(b*x^2)^p)/(2*(1 + p))]
    @test_int [(b*x^2)^p*x^0, x, 2, (x*(b*x^2)^p)/(1 + 2*p)]
    @test_int [(b*x^2)^p/x^1, x, 2, (b*x^2)^p/(2*p)]
    @test_int [(b*x^2)^p/x^2, x, 2, -((b*x^2)^p/((1 - 2*p)*x))]
    @test_int [(b*x^2)^p/x^3, x, 2, -((b*x^2)^p/(2*(1 - p)*x^2))]
    @test_int [(b*x^2)^p/x^4, x, 2, -((b*x^2)^p/((3 - 2*p)*x^3))]


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(c*x)^m*(b*x^n)^p=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(b*x^n)^(p/2)=#


    #= ::Subsubsection::Closed:: =#
    #=p>0=#


    @test_int [sqrt(b*x^3), x, 2, (2/5)*x*sqrt(b*x^3)]
    @test_int [sqrt(b*x^2), x, 2, (1/2)*x*sqrt(b*x^2)]
    @test_int [sqrt(b*x^1), x, 1, (2*(b*x)^(3/2))/(3*b)]
    @test_int [sqrt(b/x^1), x, 2, 2*sqrt(b/x)*x]
    @test_int [sqrt(b/x^2), x, 2, sqrt(b/x^2)*x*log(x)]
    @test_int [sqrt(b/x^3), x, 2, -2*sqrt(b/x^3)*x]


    @test_int [(b*x^3)^(3/2), x, 2, (2/11)*b*x^4*sqrt(b*x^3)]
    @test_int [(b*x^2)^(3/2), x, 2, (1/4)*b*x^3*sqrt(b*x^2)]
    @test_int [(b*x^1)^(3/2), x, 1, (2*(b*x)^(5/2))/(5*b)]
    @test_int [(b/x^1)^(3/2), x, 2, -2*b*sqrt(b/x)]
    @test_int [(b/x^2)^(3/2), x, 2, -((b*sqrt(b/x^2))/(2*x))]
    @test_int [(b/x^3)^(3/2), x, 2, -((2*b*sqrt(b/x^3))/(7*x^2))]


    #= ::Subsubsection::Closed:: =#
    #=p<0=#


    @test_int [1/sqrt(b*x^3), x, 2, -((2*x)/sqrt(b*x^3))]
    @test_int [1/sqrt(b*x^2), x, 2, (x*log(x))/sqrt(b*x^2)]
    @test_int [1/sqrt(b*x^1), x, 1, (2*sqrt(b*x))/b]
    @test_int [1/sqrt(b/x^1), x, 2, (2*x)/(3*sqrt(b/x))]
    @test_int [1/sqrt(b/x^2), x, 2, x/(2*sqrt(b/x^2))]
    @test_int [1/sqrt(b/x^3), x, 2, (2*x)/(5*sqrt(b/x^3))]


    @test_int [1/(b*x^3)^(3/2), x, 2, -(2/(7*b*x^2*sqrt(b*x^3)))]
    @test_int [1/(b*x^2)^(3/2), x, 2, -(1/(2*b*x*sqrt(b*x^2)))]
    @test_int [1/(b*x^1)^(3/2), x, 1, -(2/(b*sqrt(b*x)))]
    @test_int [1/(b/x^1)^(3/2), x, 2, (2*x^2)/(5*b*sqrt(b/x))]
    @test_int [1/(b/x^2)^(3/2), x, 2, x^3/(4*b*sqrt(b/x^2))]
    @test_int [1/(b/x^3)^(3/2), x, 2, (2*x^4)/(11*b*sqrt(b/x^3))]


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(b*x^n)^(p/3)=#


    #= ::Subsubsection::Closed:: =#
    #=p>0=#


    @test_int [(b*x^n)^(1/3), x, 2, (3*x*(b*x^n)^(1/3))/(3 + n)]

    @test_int [(b*x^3)^(1/3), x, 2, (1/2)*x*(b*x^3)^(1/3)]
    @test_int [(b*x^2)^(1/3), x, 2, (3/5)*x*(b*x^2)^(1/3)]
    @test_int [(b*x^1)^(1/3), x, 1, (3*(b*x)^(4/3))/(4*b)]
    @test_int [(b/x^1)^(1/3), x, 2, (3/2)*(b/x)^(1/3)*x]
    @test_int [(b/x^2)^(1/3), x, 2, 3*(b/x^2)^(1/3)*x]
    @test_int [(b/x^3)^(1/3), x, 2, (b/x^3)^(1/3)*x*log(x)]
    @test_int [(b/x^4)^(1/3), x, 2, -3*(b/x^4)^(1/3)*x]


    @test_int [(b*x^n)^(2/3), x, 2, (3*x*(b*x^n)^(2/3))/(3 + 2*n)]

    @test_int [(b*x^2)^(2/3), x, 2, (3/7)*x*(b*x^2)^(2/3)]
    @test_int [(b*x^1)^(2/3), x, 1, (3*(b*x)^(5/3))/(5*b)]
    @test_int [(b/x^1)^(2/3), x, 2, 3*(b/x)^(2/3)*x]
    @test_int [(b/x^2)^(2/3), x, 2, -3*(b/x^2)^(2/3)*x]
    @test_int [(b/x^3)^(2/3), x, 2, (-(b/x^3)^(2/3))*x]
    @test_int [(b/x^4)^(2/3), x, 2, (-(3/5))*(b/x^4)^(2/3)*x]


    #= ::Subsubsection::Closed:: =#
    #=p<0=#


    @test_int [1/(b*x^n)^(1/3), x, 2, (3*x)/((3 - n)*(b*x^n)^(1/3))]

    @test_int [1/(b*x^4)^(1/3), x, 2, -((3*x)/(b*x^4)^(1/3))]
    @test_int [1/(b*x^3)^(1/3), x, 2, (x*log(x))/(b*x^3)^(1/3)]
    @test_int [1/(b*x^2)^(1/3), x, 2, (3*x)/(b*x^2)^(1/3)]
    @test_int [1/(b*x^1)^(1/3), x, 1, (3*(b*x)^(2/3))/(2*b)]
    @test_int [1/(b/x^1)^(1/3), x, 2, (3*x)/(4*(b/x)^(1/3))]
    @test_int [1/(b/x^2)^(1/3), x, 2, (3*x)/(5*(b/x^2)^(1/3))]
    @test_int [1/(b/x^3)^(1/3), x, 2, x/(2*(b/x^3)^(1/3))]


    @test_int [1/(b*x^n)^(2/3), x, 2, (3*x)/((3 - 2*n)*(b*x^n)^(2/3))]

    @test_int [1/(b*x^3)^(2/3), x, 2, -(x/(b*x^3)^(2/3))]
    @test_int [1/(b*x^2)^(2/3), x, 2, -((3*x)/(b*x^2)^(2/3))]
    @test_int [1/(b*x^1)^(2/3), x, 1, (3*(b*x)^(1/3))/b]
    @test_int [1/(b/x^1)^(2/3), x, 2, (3*x)/(5*(b/x)^(2/3))]
    @test_int [1/(b/x^2)^(2/3), x, 2, (3*x)/(7*(b/x^2)^(2/3))]
    @test_int [1/(b/x^3)^(2/3), x, 2, x/(3*(b/x^3)^(2/3))]


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*x^m*(b*x^n)^(p/2)=#


    #= ::Subsubsection::Closed:: =#
    #=p>0=#


    @test_int [x^2*sqrt(b*x^n), x, 2, (2*x^3*sqrt(b*x^n))/(6 + n)]
    @test_int [x^1*sqrt(b*x^n), x, 2, (2*x^2*sqrt(b*x^n))/(4 + n)]
    @test_int [x^0*sqrt(b*x^n), x, 2, (2*x*sqrt(b*x^n))/(2 + n)]
    @test_int [sqrt(b*x^n)/x^1, x, 2, (2*sqrt(b*x^n))/n]
    @test_int [sqrt(b*x^n)/x^2, x, 2, -((2*sqrt(b*x^n))/((2 - n)*x))]
    @test_int [sqrt(b*x^n)/x^3, x, 2, -((2*sqrt(b*x^n))/((4 - n)*x^2))]


    @test_int [(b*x^n)^(3/2)*x^1, x, 2, (2*b*x^(2 + n)*sqrt(b*x^n))/(4 + 3*n)]
    @test_int [(b*x^n)^(3/2)*x^0, x, 2, (2*b*x^(1 + n)*sqrt(b*x^n))/(2 + 3*n)]
    @test_int [(b*x^n)^(3/2)/x^1, x, 2, (2*b*x^n*sqrt(b*x^n))/(3*n)]
    @test_int [(b*x^n)^(3/2)/x^2, x, 2, -((2*b*x^(-1 + n)*sqrt(b*x^n))/(2 - 3*n))]
    @test_int [(b*x^n)^(3/2)/x^3, x, 2, -((2*b*x^(-2 + n)*sqrt(b*x^n))/(4 - 3*n))]
    @test_int [(b*x^n)^(3/2)/x^4, x, 2, -((2*b*x^(-3 + n)*sqrt(b*x^n))/(3*(2 - n)))]


    #= ::Subsubsection::Closed:: =#
    #=p<0=#


    @test_int [x^2/sqrt(b*x^n), x, 2, (2*x^3)/((6 - n)*sqrt(b*x^n))]
    @test_int [x^1/sqrt(b*x^n), x, 2, (2*x^2)/((4 - n)*sqrt(b*x^n))]
    @test_int [x^0/sqrt(b*x^n), x, 2, (2*x)/((2 - n)*sqrt(b*x^n))]
    @test_int [1/(x^1*sqrt(b*x^n)), x, 2, -(2/(n*sqrt(b*x^n)))]
    @test_int [1/(x^2*sqrt(b*x^n)), x, 2, -(2/((2 + n)*x*sqrt(b*x^n)))]
    @test_int [1/(x^3*sqrt(b*x^n)), x, 2, -(2/((4 + n)*x^2*sqrt(b*x^n)))]


    @test_int [1/(b*x^n)^(3/2)*x^2, x, 2, (2*x^(3 - n))/(3*b*(2 - n)*sqrt(b*x^n))]
    @test_int [1/(b*x^n)^(3/2)*x^1, x, 2, (2*x^(2 - n))/(b*(4 - 3*n)*sqrt(b*x^n))]
    @test_int [1/(b*x^n)^(3/2)*x^0, x, 2, (2*x^(1 - n))/(b*(2 - 3*n)*sqrt(b*x^n))]
    @test_int [1/(b*x^n)^(3/2)/x^1, x, 2, -(2/(x^n*(3*b*n*sqrt(b*x^n))))]
    @test_int [1/(b*x^n)^(3/2)/x^2, x, 2, -((2*x^(-1 - n))/(b*(2 + 3*n)*sqrt(b*x^n)))]
    @test_int [1/(b*x^n)^(3/2)/x^3, x, 2, -((2*x^(-2 - n))/(b*(4 + 3*n)*sqrt(b*x^n)))]
    @test_int [1/(b*x^n)^(3/2)/x^4, x, 2, -((2*x^(-3 - n))/(3*b*(2 + n)*sqrt(b*x^n)))]


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(c*x)^m*(b*x^n)^(p/2)*with*m*symbolic=#


    @test_int [x^m/(a*x^n)^(3/2), x, 2, (2*x^(1 + m - n))/(a*(2 + 2*m - 3*n)*sqrt(a*x^n))]
    @test_int [(c*x)^m/(a*x^n)^(3/2), x, 3, (2*x^(1 - n)*(c*x)^m)/(a*(2 + 2*m - 3*n)*sqrt(a*x^n))]


    @test_int [x^m*(b*x^n)^(3/2), x, 2, (2*b*x^(1 + m + n)*sqrt(b*x^n))/(2 + 2*m + 3*n)]
    @test_int [x^m*(b*x^n)^(1/2), x, 2, (2*x^(1 + m)*sqrt(b*x^n))/(2 + 2*m + n)]
    @test_int [x^m/(b*x^n)^(1/2), x, 2, (2*x^(1 + m))/((2 + 2*m - n)*sqrt(b*x^n))]
    @test_int [x^m/(b*x^n)^(3/2), x, 2, (2*x^(1 + m - n))/(b*(2 + 2*m - 3*n)*sqrt(b*x^n))]


