    @test_int [x^m*sqrt(a + b*sqrt(d/x) + c/x), x, 4, (sqrt(a + b*sqrt(d/x) + c/x)*x^(1 + m)*AppellF1(-2*(1 + m), -(1/2), -(1/2), -1 - 2*m, -((2*c*sqrt(d/x))/(sqrt(d)*(b*sqrt(d) - sqrt(-4*a*c + b^2*d)))), -((2*c*sqrt(d/x))/(sqrt(d)*(b*sqrt(d) + sqrt(-4*a*c + b^2*d))))))/((1 + m)*sqrt(1 + (2*c*sqrt(d/x))/(sqrt(d)*(b*sqrt(d) - sqrt(-4*a*c + b^2*d))))*sqrt(1 + (2*c*sqrt(d/x))/(sqrt(d)*(b*sqrt(d) + sqrt(-4*a*c + b^2*d)))))]

    @test_int [x^2*sqrt(a + b*sqrt(d/x) + c/x), x, 9, -((3*b*d^3*(a + b*sqrt(d/x) + c/x)^(3/2))/(10*a^2*(d/x)^(5/2))) + (7*b*d^2*(28*a*c - 15*b^2*d)*(a + b*sqrt(d/x) + c/x)^(3/2))/(480*a^4*(d/x)^(3/2)) + ((16*a^2*c^2 - 56*a*b^2*c*d + 21*b^4*d^2)*(2*a + b*sqrt(d/x))*sqrt(a + b*sqrt(d/x) + c/x)*x)/(256*a^5) - ((20*a*c - 21*b^2*d)*(a + b*sqrt(d/x) + c/x)^(3/2)*x^2)/(80*a^3) + ((a + b*sqrt(d/x) + c/x)^(3/2)*x^3)/(3*a) + ((4*a*c - b^2*d)*(16*a^2*c^2 - 56*a*b^2*c*d + 21*b^4*d^2)*atanh((2*a + b*sqrt(d/x))/(2*sqrt(a)*sqrt(a + b*sqrt(d/x) + c/x))))/(512*a^(11/2))]
    @test_int [x^1*sqrt(a + b*sqrt(d/x) + c/x), x, 7, -((5*b*d^2*(a + b*sqrt(d/x) + c/x)^(3/2))/(12*a^2*(d/x)^(3/2))) - ((4*a*c - 5*b^2*d)*(2*a + b*sqrt(d/x))*sqrt(a + b*sqrt(d/x) + c/x)*x)/(32*a^3) + ((a + b*sqrt(d/x) + c/x)^(3/2)*x^2)/(2*a) - ((4*a*c - 5*b^2*d)*(4*a*c - b^2*d)*atanh((2*a + b*sqrt(d/x))/(2*sqrt(a)*sqrt(a + b*sqrt(d/x) + c/x))))/(64*a^(7/2))]
    @test_int [x^0*sqrt(a + b*sqrt(d/x) + c/x), x, 5, ((2*a + b*sqrt(d/x))*sqrt(a + b*sqrt(d/x) + c/x)*x)/(2*a) + ((4*a*c - b^2*d)*atanh((2*a + b*sqrt(d/x))/(2*sqrt(a)*sqrt(a + b*sqrt(d/x) + c/x))))/(4*a^(3/2))]
    @test_int [sqrt(a + b*sqrt(d/x) + c/x)/x^1, x, 8, -2*sqrt(a + b*sqrt(d/x) + c/x) + 2*sqrt(a)*atanh((2*a + b*sqrt(d/x))/(2*sqrt(a)*sqrt(a + b*sqrt(d/x) + c/x))) - (b*sqrt(d)*atanh((b*d + 2*c*sqrt(d/x))/(2*sqrt(c)*sqrt(d)*sqrt(a + b*sqrt(d/x) + c/x))))/sqrt(c)]
    @test_int [sqrt(a + b*sqrt(d/x) + c/x)/x^2, x, 6, (b*(b*d + 2*c*sqrt(d/x))*sqrt(a + b*sqrt(d/x) + c/x))/(4*c^2) - (2*(a + b*sqrt(d/x) + c/x)^(3/2))/(3*c) + (b*sqrt(d)*(4*a*c - b^2*d)*atanh((b*d + 2*c*sqrt(d/x))/(2*sqrt(c)*sqrt(d)*sqrt(a + b*sqrt(d/x) + c/x))))/(8*c^(5/2))]
    @test_int [sqrt(a + b*sqrt(d/x) + c/x)/x^3, x, 7, -((b*(12*a*c - 7*b^2*d)*(b*d + 2*c*sqrt(d/x))*sqrt(a + b*sqrt(d/x) + c/x))/(64*c^4)) + ((32*a*c - 35*b^2*d + 42*b*c*sqrt(d/x))*(a + b*sqrt(d/x) + c/x)^(3/2))/(120*c^3) - (2*(a + b*sqrt(d/x) + c/x)^(3/2))/(5*c*x) - (b*sqrt(d)*(12*a*c - 7*b^2*d)*(4*a*c - b^2*d)*atanh((b*d + 2*c*sqrt(d/x))/(2*sqrt(c)*sqrt(d)*sqrt(a + b*sqrt(d/x) + c/x))))/(128*c^(9/2))]
    @test_int [sqrt(a + b*sqrt(d/x) + c/x)/x^4, x, 9, (b*(80*a^2*c^2 - 120*a*b^2*c*d + 33*b^4*d^2)*(b*d + 2*c*sqrt(d/x))*sqrt(a + b*sqrt(d/x) + c/x))/(512*c^6) - ((1024*a^2*c^2 - 3276*a*b^2*c*d + 1155*b^4*d^2 + 18*b*c*(148*a*c - 77*b^2*d)*sqrt(d/x))*(a + b*sqrt(d/x) + c/x)^(3/2))/(6720*c^5) + (11*b*(a + b*sqrt(d/x) + c/x)^(3/2)*(d/x)^(3/2))/(42*c^2*d) - (2*(a + b*sqrt(d/x) + c/x)^(3/2))/(7*c*x^2) + ((32*a*c - 33*b^2*d)*(a + b*sqrt(d/x) + c/x)^(3/2))/(140*c^3*x) + (b*sqrt(d)*(4*a*c - b^2*d)*(80*a^2*c^2 - 120*a*b^2*c*d + 33*b^4*d^2)*atanh((b*d + 2*c*sqrt(d/x))/(2*sqrt(c)*sqrt(d)*sqrt(a + b*sqrt(d/x) + c/x))))/(1024*c^(13/2))]


    @test_int [x^m/sqrt(a + b*sqrt(d/x) + c/x), x, 4, (sqrt(1 + (2*c*sqrt(d/x))/(sqrt(d)*(b*sqrt(d) - sqrt(-4*a*c + b^2*d))))*sqrt(1 + (2*c*sqrt(d/x))/(sqrt(d)*(b*sqrt(d) + sqrt(-4*a*c + b^2*d))))*x^(1 + m)*AppellF1(-2*(1 + m), 1/2, 1/2, -1 - 2*m, -((2*c*sqrt(d/x))/(sqrt(d)*(b*sqrt(d) - sqrt(-4*a*c + b^2*d)))), -((2*c*sqrt(d/x))/(sqrt(d)*(b*sqrt(d) + sqrt(-4*a*c + b^2*d))))))/((1 + m)*sqrt(a + b*sqrt(d/x) + c/x))]

    @test_int [x^2/sqrt(a + b*sqrt(d/x) + c/x), x, 10, -((11*b*d^3*sqrt(a + b*sqrt(d/x) + c/x))/(30*a^2*(d/x)^(5/2))) + (b*d^2*(156*a*c - 77*b^2*d)*sqrt(a + b*sqrt(d/x) + c/x))/(160*a^4*(d/x)^(3/2)) - (7*b*d*(528*a^2*c^2 - 680*a*b^2*c*d + 165*b^4*d^2)*sqrt(a + b*sqrt(d/x) + c/x))/(1280*a^6*sqrt(d/x)) + ((400*a^2*c^2 - 1176*a*b^2*c*d + 385*b^4*d^2)*sqrt(a + b*sqrt(d/x) + c/x)*x)/(640*a^5) - ((100*a*c - 99*b^2*d)*sqrt(a + b*sqrt(d/x) + c/x)*x^2)/(240*a^3) + (sqrt(a + b*sqrt(d/x) + c/x)*x^3)/(3*a) - ((320*a^3*c^3 - 1680*a^2*b^2*c^2*d + 1260*a*b^4*c*d^2 - 231*b^6*d^3)*atanh((2*a + b*sqrt(d/x))/(2*sqrt(a)*sqrt(a + b*sqrt(d/x) + c/x))))/(512*a^(13/2))]
    @test_int [x^1/sqrt(a + b*sqrt(d/x) + c/x), x, 8, -((7*b*d^2*sqrt(a + b*sqrt(d/x) + c/x))/(12*a^2*(d/x)^(3/2))) + (5*b*d*(44*a*c - 21*b^2*d)*sqrt(a + b*sqrt(d/x) + c/x))/(96*a^4*sqrt(d/x)) - ((36*a*c - 35*b^2*d)*sqrt(a + b*sqrt(d/x) + c/x)*x)/(48*a^3) + (sqrt(a + b*sqrt(d/x) + c/x)*x^2)/(2*a) + ((48*a^2*c^2 - 120*a*b^2*c*d + 35*b^4*d^2)*atanh((2*a + b*sqrt(d/x))/(2*sqrt(a)*sqrt(a + b*sqrt(d/x) + c/x))))/(64*a^(9/2))]
    @test_int [x^0/sqrt(a + b*sqrt(d/x) + c/x), x, 6, -((3*b*d*sqrt(a + b*sqrt(d/x) + c/x))/(2*a^2*sqrt(d/x))) + (sqrt(a + b*sqrt(d/x) + c/x)*x)/a - ((4*a*c - 3*b^2*d)*atanh((2*a + b*sqrt(d/x))/(2*sqrt(a)*sqrt(a + b*sqrt(d/x) + c/x))))/(4*a^(5/2))]
    @test_int [1/(x^1*sqrt(a + b*sqrt(d/x) + c/x)), x, 4, (2*atanh((2*a + b*sqrt(d/x))/(2*sqrt(a)*sqrt(a + b*sqrt(d/x) + c/x))))/sqrt(a)]
    @test_int [1/(x^2*sqrt(a + b*sqrt(d/x) + c/x)), x, 5, -((2*sqrt(a + b*sqrt(d/x) + c/x))/c) + (b*sqrt(d)*atanh((b*d + 2*c*sqrt(d/x))/(2*sqrt(c)*sqrt(d)*sqrt(a + b*sqrt(d/x) + c/x))))/c^(3/2)]
    @test_int [1/(x^3*sqrt(a + b*sqrt(d/x) + c/x)), x, 6, ((16*a*c - 15*b^2*d + 10*b*c*sqrt(d/x))*sqrt(a + b*sqrt(d/x) + c/x))/(12*c^3) - (2*sqrt(a + b*sqrt(d/x) + c/x))/(3*c*x) - (b*sqrt(d)*(12*a*c - 5*b^2*d)*atanh((b*d + 2*c*sqrt(d/x))/(2*sqrt(c)*sqrt(d)*sqrt(a + b*sqrt(d/x) + c/x))))/(8*c^(7/2))]
    @test_int [1/(x^4*sqrt(a + b*sqrt(d/x) + c/x)), x, 8, -(((1024*a^2*c^2 - 2940*a*b^2*c*d + 945*b^4*d^2 + 14*b*c*(92*a*c - 45*b^2*d)*sqrt(d/x))*sqrt(a + b*sqrt(d/x) + c/x))/(960*c^5)) + (9*b*sqrt(a + b*sqrt(d/x) + c/x)*(d/x)^(3/2))/(20*c^2*d) - (2*sqrt(a + b*sqrt(d/x) + c/x))/(5*c*x^2) + ((64*a*c - 63*b^2*d)*sqrt(a + b*sqrt(d/x) + c/x))/(120*c^3*x) + (b*sqrt(d)*(240*a^2*c^2 - 280*a*b^2*c*d + 63*b^4*d^2)*atanh((b*d + 2*c*sqrt(d/x))/(2*sqrt(c)*sqrt(d)*sqrt(a + b*sqrt(d/x) + c/x))))/(128*c^(11/2))]


    @test_int [sqrt(sqrt(1/x) + 1/x), x, 2, (4*(sqrt(1/x) + 1/x)^(3/2))/(3*(1/x)^(3/2))]
    @test_int [sqrt(2 + sqrt(1/x) + 1/x), x, 5, (1/4)*(4 + sqrt(1/x))*sqrt(2 + sqrt(1/x) + 1/x)*x + (7*atanh((4 + sqrt(1/x))/(2*sqrt(2)*sqrt(2 + sqrt(1/x) + 1/x))))/(8*sqrt(2))]


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(c*x^n)^(1/n)*(a+b*(c*x^n)^(m/n))^p=#


    @test_int [(c*x^n)^(1/n)*(a + b*(c*x^n)^(1/n))^p, x, 4, -((a*x*(a + b*(c*x^n)^(1/n))^(1 + p))/((c*x^n)^n^(-1)*(b^2*(1 + p)))) + (x*(a + b*(c*x^n)^(1/n))^(2 + p))/((c*x^n)^n^(-1)*(b^2*(2 + p)))]


    @test_int [(c*x^n)^(1/n)*(a + b*(c*x^n)^(1/n))^3, x, 4, -((a*x*(a + b*(c*x^n)^(1/n))^4)/((c*x^n)^n^(-1)*(4*b^2))) + (x*(a + b*(c*x^n)^(1/n))^5)/((c*x^n)^n^(-1)*(5*b^2))]
    @test_int [(c*x^n)^(1/n)*(a + b*(c*x^n)^(1/n))^2, x, 4, (1/2)*a^2*x*(c*x^n)^(1/n) + (2/3)*a*b*x*(c*x^n)^(2/n) + (1/4)*b^2*x*(c*x^n)^(3/n)]
    @test_int [(c*x^n)^(1/n)*(a + b*(c*x^n)^(1/n))^1, x, 5, (1/2)*a*x*(c*x^n)^(1/n) + (1/3)*b*x*(c*x^n)^(2/n)]
    @test_int [(c*x^n)^(1/n)/(a + b*(c*x^n)^(1/n))^1, x, 4, x/b - (a*x*log(a + b*(c*x^n)^(1/n)))/((c*x^n)^n^(-1)*b^2)]
    @test_int [(c*x^n)^(1/n)/(a + b*(c*x^n)^(1/n))^2, x, 4, (a*x)/((c*x^n)^n^(-1)*(b^2*(a + b*(c*x^n)^(1/n)))) + (x*log(a + b*(c*x^n)^(1/n)))/((c*x^n)^n^(-1)*b^2)]
    @test_int [(c*x^n)^(1/n)/(a + b*(c*x^n)^(1/n))^3, x, 3, (x*(c*x^n)^(1/n))/(2*a*(a + b*(c*x^n)^(1/n))^2)]
    @test_int [(c*x^n)^(1/n)/(a + b*(c*x^n)^(1/n))^4, x, 4, (a*x)/((c*x^n)^n^(-1)*(3*b^2*(a + b*(c*x^n)^(1/n))^3)) - x/((c*x^n)^n^(-1)*(2*b^2*(a + b*(c*x^n)^(1/n))^2))]
    @test_int [(c*x^n)^(1/n)/(a + b*(c*x^n)^(1/n))^5, x, 4, (a*x)/((c*x^n)^n^(-1)*(4*b^2*(a + b*(c*x^n)^(1/n))^4)) - x/((c*x^n)^n^(-1)*(3*b^2*(a + b*(c*x^n)^(1/n))^3))]
    end
